import React, { FC, useState } from 'react'
import styles from './List.module.scss'
import QuestionCard from '../components/QuestionCard'

const List: FC = () => {
  const [questionList, setQuestionList] = useState([
    {
      id: 'q1',
      title: '问卷1',
      isPublished: false,
    },
    {
      id: 'q2',
      title: '问卷2',
      isPublished: false,
    },
    {
      id: 'q3',
      title: '问卷3',
      isPublished: false,
    },
    {
      id: 'q4',
      title: '问卷4',
      isPublished: false,
    },
  ])
  return (
    <>
      <QuestionCard></QuestionCard>
    </>
  )
}
export default List
